import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from './Home';
import Nav from "./Nav";
import Contact from './Contact';

function App() {
  return (
    <Router>
      <div className="App">
      <Nav/>
      <Switch>
        <Route exact path='/'>
          <Home/>
        </Route>
        <Route exact path='/contact'>
          <Contact/>
        </Route>
        <Route exact path='/contac'>

        </Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
